import ListItem from "./ListItem";

function Ravenclaw({id, names}){

  console.log("(R) Students: ", names)

  return(
    <div>
      <header>
      Ravenclaw Students
      </header>
      {<ListItem 
      key={id}
      student_name={names}
      onRemove={handleRemove}
      /> }
    </div>
  )
}

export default Ravenclaw;
